import React from 'react';
import {HomeRoundedIcon} from '@material-ui/icons';
import {ClassRoundedIcon} from '@material-ui/icons';
import {CalendarTodayRoundedIcon} from '@material-ui/icons';
import {ListRoundedIcon} from '@material-ui/icons';
import {TimerRoundedIcon} from '@material-ui/icons';

const NavBarItems =[
    {
        title: "Home",
        icon: <HomeRoundedIcon/>
    },

    {
        title: "Units",
        icon: <ClassRoundedIcon/>
    },

    {
        title: "Calendar",
        icon: <CalendarTodayRoundedIcon/>
    },

    {
        title: "Reminder",
        icon: <ListRoundedIcon/>
    },

    {
        title: "Study Timer",
        icon: <TimerRoundedIcon/>
    },

];
export default NavBarItems
